        case 14;WaveRSR=WaveB14;BandRSR=Band14;
        case 15;WaveRSR=WaveB15;BandRSR=Band15;    
    end
    % Version 3
    BandRSRInterp   = interp1(WaveRSR,BandRSR,InputwaveNM); % need to interpolate the data so that the things match up spectral, in steps, and range.
