    Diff            = diff(InputwaveNM);                    % Take the "diff", can't assume a regular spaceing or size of spacing
    Diff            = [Diff,Diff(end)];                     % since Diff produces a n-1 array we are "short" a value, so assume the space of the last value is valid (for equally spaced data this works fine)
    Intergrate      = sum(InputSpectrum .* BandRSRInterp .* Diff); % okay time to multiply the radiance by the SRS and then "intergrate"
    Normalize        = sum(BandRSRInterp .* Diff);           % Normalize by the intergrate spectal response
    Band            = Intergrate / Normalize;
    Banded          = [Banded, Band];
    clear BandRSRInterp Diff Intergrate Normalize Band WaveRSR BandRSR
    
